Listing.where(title: "2001 Chevrolet Silverado 1500", description: "Our One Owner, Clean Carfax Chevrolet Silverado 1500 LS in Indigo Blue Metallic is proof positive that Chevrolet trucks are as good as it gets. Our rear wheel drive Silverado has a 4.8 Liter V8 engine with enough horsepower to smoke the rear tires at will. That means enough horses for light towing and hauling, but it's also a lot of fun for commuting and touring, all while scoring 20mpg highway.   You'll be pleasantly surprised when you climb through one of the rear-opening auxiliary doors of our Extended Cab Silverado and into the back seat, which has a boatload of room and just as much comfort. Six can ride in comfort, and conveniences and pleasantries abound inside and out: all-season tires, cushy seats, ABS, nice stereo system, airbags, power accessories, leather-wrapped tilt steering wheel, and daytime running lights.  If you're shopping for a full-sized pickup, this one deserves a spot on your short list. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2001, miles: 153157, transmission: "Automatic", color: "Indigo Blue Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 6999, newused: "Used", vin: "2GCEC19VX11195452", stocknumber: "FCSJ048", model: "Silverado 1500", trim: "LS", enginedescription: "4.8L 8 Cylinders", interiorcolor: "Medium Gray", options: "Air Conditioning : A/C,Convenience : Front Reading Lamps,Convenience : Intermittent Wipers,Convenience : Leather Steering Wheel,Convenience : Power Outlet,Convenience : Security System,Locks : Keyless Entry,Locks : Power Door Locks,Pwr Windows W/Backlit Switches,Seats : Driver 