Listing.where(title: "2003 Chevrolet TrailBlazer", description: "Get behind the wheel of our Clean Carfax 2003 Chevrolet TrailBlazer EXT LS shown in Dark Gray Metlallic. Boasting a 275hp 4.2 Liter 6 Cylinder paired with a responsive 4 Speed Automatic, this hefty Rear Wheel Drive SUV provides all the power you demand.   Our LS trim comes with all sorts of goodies! Check out the AM/FM/CD stereo, passenger climate control, automatic headlights, full power accessories and more! There's plenty of seating for you, your family, friends, pets and the kitchen sink (not included)! Standard equipment on this beast are plenty of airbags and ABS in addition to steel door beams.  A complete tow package is also standard, and is great for dragging your water toys behind you! Jackpot! Load 'em up, move 'em out! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2003, miles: 117022, transmission: "Automatic", color: "Dark Gray Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 5499, newused: "Used", vin: "1GNES16SX36225923", stocknumber: "CCSJ228", model: "TrailBlazer", trim: "EXT LS", enginedescription: "4.2L 6 Cylinders", interiorcolor: "Medium Pewter", options: "Air Bags, Frontal, Driver & Right Front Passenger,Air Conditioning : Multi-Zone A/C,Audio : Cd Player,Child Seat Restraint System,Convenience : Power Outlet,Convenience : Universal Garage Door Opener,Door Locks, Child Security, Rear,Locks : Power Door Locks,Ls Decor,Seats : 3Rd Row Seat,Seats : Bucket Seats,Seats : Pass-Through Rear Seat,Seats : Power Driver Seat,Theft-Deterrent System, Passlock,Window : Power Windows", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: "SUV", make: "Chevrolet", approved: true, expiration_date: "2218-01-03 01:44:43", external_url: true, external_image: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/195016/20180331181602689_DSC_2649.jpg", external_imagefront: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/195016/20180331181559332_DSC_2650.jpg", external_imageback: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/195016/20180331181844403_CCF08092017%20-%20Copy.jpg", external_imageleft: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/195016/20180331181613263_DSC_2651.jpg", external_imageright: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/195016/20180331181606122_DSC_2652.jpg", external_frontinterior: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/195016/20180331181609610_DSC_2653.jpg", external_rearinterior: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/195016/20180331181620482_DSC_2654.jpg").first_or_create
Listing.where(title: "2010 Chrysler 300", description: "An attention-grabbing exterior, an incredible driving experience, and a powerful V6 engine should put our Clean Carfax 2010 Chrysler 300 in Black Crystal Pearl near the top of your short list. This powerhouse boasts a 3.5 Liter V6 that throws out 250hp for loads of get up and go. Coupled with a smooth shifting 4-Speed automatic transmission, this Rear Wheel Drive evens out the bumps and cracks in the road, earning a pleasing 25mpg highway.  Our upscale Touring will reward you with comfort, amenities, safety features, performance, and a certain social status that will be the envy of the neighborhood. Check out the incredible audio system with CD/MP3 and auxiliary input, a full complement of power accessories, heated mirrors, stability assist, brake assist, power adjustable pedals, and more. Yes, our pictures of this 300 are nice, but you've got to see this gorgeous sedan in person!  Bottom line, this Chrysler 300 sedan turns heads simply with its bold yet refined styling. Add to that a boatload of features; a smooth, comfortable ride; and a powerful engine, and the result will be almost legendary. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2010, miles: 99311, transmission: "Automatic", color: "Brilliant Black Crystal Pearl", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 8999, newused: "Used", vin: "2C3CA5CV9AH105166", stocknumber: "DCSJ248", model: "300", trim: "Touring", enginedescription: "3.5L 6 Cylinders", interiorcolor: "Dark Slate Gray", options: "Air Conditioning : Multi-Zone A/C,Audio : Auxiliary Audio Input,Audio : Cd Player,Audio : Mp3 P