Listing.where(title: "2005 Ford Expedition", description: "There is plenty to like about our super-sized Clean Carfax 2005 Ford Expedition in Maroon! Let's talk about the new-for-2005 Triton V8. Displacing 5.4 Liters and making 300hp, this engine features a 3-valve head design that allows the engine to breathe better. As a result it now has more horsepower, torque, and better fuel economy. This Rear Wheel Drive machine is ready to take you wherever life leads!  Our Eddie Bauer trim includes all the bells and whistles you can think of... leather seats, a rear DVD player, and the list goes on! There is loads of room for you and your family, too! Ford has filled this one with all the latest in safety features as well!  If you get bored enough to start reading the dictionary, look up the word expedition - \"a journey undertaken by a group of people with a definite objective\". Sounds like a plan! Let the journey begin right here! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2005, miles: 149459, transmission: "Automatic", color: "Maroon", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 6499, newused: "Used", vin: "1FMPU175X5LA76448", stocknumber: "ECSJ038", model: "Expedition", trim: "Eddie Bauer", enginedescription: "5.4L 8 Cylinders", interiorcolor: "Medium Parchment", options: "Air Conditioning : Multi-Zone A/C,Audio : Cd Changer,Audio : Premium Sound System,Audio : Rear Seat Audio Controls,Convenience : Power Outlet,Convenience : Steering Wheel Audio Controls,Locks : Keyless Entry,Locks : Power Door Locks,Pwr Adjustable Accelerator/Brake Pedals W/2-Position Memory,Seats : 3Rd Row Seat,Seats : Power Driver 