Listing.where(title: "2002 Ford Explorer", description: "Now here's a suburban family hauler that has a leg up on the competition....This Clean Carfax 2002 Ford Explorer XLT in Mineral Grey Metallic is ultra-roomy and comfortable. Our Explorer XLT is equipped with a big 4.0L V6 and all the comfort and convenience features you need. So this 5-Speed automatic Rear Wheel Drive is ready to hit the road with you, your family/friends/crew, and everyone's gear, while minimizing the bickering from the kids! Woo hoo!  Our XLT trim rides smoothly, handles well, and the interior packaging is so close to perfect, it's scary! It's a great SUV for long trips as well as trafficking through the suburban jungle! Five people ride with ease with so many amenities and safety features that everyone will be smiling. Check out the pictures - leather upholstery, full power accessories, automatic headlights, ABS, an outstanding audio system, auto-dimming rearview mirror, airbags, and so much more!  This is one that simply must be checked out! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2002, miles: 101611, transmission: "Automatic", color: "Mineral Grey Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 5500, newused: "Used", vin: "1FMZU63K22ZD00791", stocknumber: "ECSJ098", model: "Explorer", trim: "XLT", enginedescription: "4L 6 Cylinders", interiorcolor: "Med Parchment", options: "Air Conditioning : Rear A/C,Audio : Cd Player,Convenience : Luggage Rack,Convenience : Power Outlet,Convenience : Security System,Locks : Keyless Entry,Locks : Power Door Locks,Pwr Windows-Inc: Illuminated Controls, \"One-Touch-Down\" Driver