Listing.where(title: "2001 Ford Explorer", description: "This 2001 Ford Explorer XLT shown in Harvest Gold Metallic is ultra-roomy and comfortable. Our Explorer XLT is equipped with a big 5.0 Liter V8 mated with a 5 Speed Automatic transmission. Our Rear Wheel Drive XLT provides plenty of passing power, a smooth ride, and nearly 19mpg on the open road.   Our XLT trim is a great SUV for long trips as well as trafficking through the suburban jungle! You will enjoy soft touch seating, power accessories, AM/FM/CD stereo, keyless entry, and cruise control on the steering wheel. A large cargo area is perfect for all your gear, backpacks, and groceries.   ABS, 4-wheel disc brakes, air bags, and more are included on the safety list for added peace of mind. This is one that simply must be checked out! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2001, miles: 118293, transmission: "Automatic", color: "Harvest Gold Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 4599, newused: "Used", vin: "1FMZU63P11UB19320", stocknumber: "CCSJ238", model: "Explorer", trim: "XLT", enginedescription: "5L 8 Cylinders", interiorcolor: "Med Prairie Tan", options: "Air Conditioning : Rear A/C,Audio : Cd Player,Audio : Rear Seat Audio Controls,Convenience : Power Outlet,Driver & Front Passenger \"Second Generation\" Airbags,Locks : Keyless Entry,Locks : Power Door Locks,Mirrors : Power Mirror(S),Pwr Accessory Delay,Pwr Windows-Inc: Illuminated Controls, \"One-Touch-Down\" Driver Window,Seats : Bucket Seats,Seats : Pass-Through Rear Seat,Seats : Power Driver Seat,Securilock Passive Anti-Theft System,Window : Privacy Glass", ima