Listing.where(title: "2005 GMC Envoy", description: "Our 2005 Envoy with Clear Carfax, delivers a spacious interior and outstanding towing capacity! It has all the right features to compete in this segment, as well as a comfortable ride and ample power.  It's an attractive SUV in terms of design and features. It follows the traditional approach to SUV design, which means it has a truck-based ladder-frame chassis. Luxury and performance features are fully up to date. Take a look at our pictures and full options list for this Envoy and you will see that this SLE trim adds all the right features to make your daily commute more enjoyable. Power comes from a 4.2-liter in-line-six rated at 291 horsepower and 277 pound-feet of torque. This engine outguns most of its competitors' V8s, let alone their V6 offerings. Lets not forget, this Envoy is a four-wheel-drive and that speaks for itself!  This Envoy is well-engineered and enjoyable to drive, stable and responsive with good brakes and a superb in-line six-cylinder engine.So- Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2005, miles: 113530, transmission: "Automatic", color: "Liquid Silver Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 5775, newused: "Used", vin: "1GKDT13S652180144", stocknumber: "IAUN97", model: "Envoy", trim: "SLE", enginedescription: "4.2L 6 Cylinders", interiorcolor: "Light Gray", options: "Air Bags, Frontal, Driver And Right Front Passenger, Includes Passenger Sensing System (Always Use Safety Belts And Proper Child Restraints, Even With Air Bags. Children Are Safer When Properly Secured In A Rear Seat. See The Owners Manual For More Safety Information.,Air Conditioning : Multi-Zone A/C,Air Conditioning, Dual-Zone, Manual, Individual Climat