Listing.where(title: "2001 GMC Sonoma", description: "Our 2001 GMC Sonoma SLS Extended Cab in Summit White is one of the most capable compact trucks on the market - it simply does everything well. Practicality and the ever-increasing use of trucks as personal transportation seem to be the primary reason behind its popularity. Powering our Sonoma is a 4.3 Liter 6 Cylinder connected to a 4 Speed Automatic. You can wave as you pass by the gas pumps because this Rear Wheel Drive will secure nearly 22mpg on the highway. The outside of our Extended Cab displays privacy glass, automatic headlights, and camper shell.   This SLS trimmed cabin has fun cloth seating, manual windows, easy to read gauges, A/C, AM/FM radio, third and fourth reverse open passenger doors, and more. Take a look at our pictures and features list to see what all this GMC truck has to offer.  The safety features include air bags, daytime running lights, and ABS. This truck offers class-leading ride quality and excellent looks. It is ready and willing to work hard and even play hard! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2001, miles: 94016, transmission: "Automatic", color: "Summit White", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 6999, newused: "Used", vin: "1GTDT19W31K181218", stocknumber: "ECSJ208", model: "Sonoma", trim: "SLS", enginedescription: "4.3L 6 Cylinders", interiorcolor: "Gray", options: "(2) Dash-Mounted Pwr Outlets,Air Bag - Frontal : Passenger Air Bag On/Off Switch,Audio : Am/Fm Stereo,Child Safety Seat Anchors,Color-Keyed Manual Lap Safety Belt, Front Center Seat/Rear Seat Positions,Color-Keyed Manual Lap/Should