Listing.where(title: "2006 GMC Yukon", description: "Nothing can take the place of a large, powerful and roomy SUV. Our One Owner 2006 GMC Yukon SLT in Black over Grey interior fits the bill perfectly.The 5.3 Liter V8 engine is full of power on this 4x4 machine.   Inside, everything is better. Seats are lighter, more comfortable. The interior styling is refreshingly elegant, hinting at aspirations for entry-luxury status. Check out the leather seats, sunroof, wood trim and more! In addition, this one comes loaded to the roof with all the features, including safety, you could ever want!   All in all, a nice package and a real leap forward from the previous generation. So- Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2006, miles: 128412, transmission: "Automatic", color: "Onyx Black", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 10995, newused: "Used", vin: "1GKEK13T46J107555", stocknumber: "ECSJ058", model: "Yukon", trim: "SLT", enginedescription: "5.3L 8 Cylinders", interiorcolor: "Pewter/Dark Pewter", options: "Entertainment System, Rear Seat,Sunroof, Power, Tilt-Sliding,Air Conditioning : Multi-Zone A/C,Air Conditioning : Rear A/C,Audio : Cd Player,Audio : Premium Sound System,Audio : Rear Seat Audio Controls,Convenience : Front Reading Lamps,Convenience : Intermittent Wipers,Convenience : Leather Steering Wheel,Convenience : Security System,Convenience : Steering Wheel Audio Controls,Cruise Control, Electronic With Set And Resume Speed, Includes Telltale In Instrument Panel Cluster,Locks : Keyless Entry,Locks : Power Door Locks,Seats : Bucket Seats,Window : Power Windows", imagefront: nil, imageback