Listing.where(title: "2003 GMC Yukon XL", description: "Our Clean Carfax 2003 GMC Yukon XL in Carbon Metallic is a maximum-size SUV for maximum-size projects. This brute boasts a 5.3 Liter Flex Fuel V8 engine that powers out 285hp. Coupled with a Rear Wheel Drive 4 Speed Automatic transmission, this elegant machine will take you anywhere you need to go, along with all the baggage and cargo you need to haul and look pretty fantastic in the process! Check out those wheels... And the running boards... And the chrome bumpers and grille! It almost looks like its growling!  Our pictures show the immaculate interior and exterior. This beauty is loaded, so be sure to scan the feature list, too. The Yukon name stands for luxury and the SLT trim has plenty of it! The luscious leather seating for up to SEVEN, incredible sound system, and a roof rack are just a few of the amenities assuring you and your passengers of a comfortable ride. Add in all the GM safety features, and you will be holding the road solidly.   This GMC Yukon XL moves people and gear like nothing else and has no peers among sport utilities when it comes to towing. Here is your opportunity to own both a beauty and a beast - all in one vehicle! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2003, miles: 149293, transmission: "Automatic", color: "Carbon Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 6599, newused: "Used", vin: "3GKEC16T03G340550", stocknumber: "ECSJ218", model: "Yukon XL", trim: "SLE", enginedescription: "5.3L 8 Cylinders", interiorcolor: "Neutral/Shale", options: "Air Conditioning : Multi-Zone A/C,Convenience : Luggage Rac