Listing.where(title: "2001 Honda Accord Cpe", description: "Own the high end of the fantastically popular One Owner 2001 Honda Accord EX Coupe in Satin Silver Metallic and enjoy classic styling, great power, and great fuel economy as well. This is one of the most user-friendly automobiles you can imagine! Its 200hp 3.0 Liter V6 makes accelerating up the on-ramp an exhilarating experience. With its responsive Automatic transmission, our Front Wheel Drive also earns almost 30mpg on the highway. Great news for visiting the gas station fewer times!  Take a peek at the equipment list on our 2001 EX trim and see the incredible appointments on this car. From its CD changer to the sunroof illuminating the leather interior, this car is going to please driver and passenger alike. Ergonomics have been applied to make sure the interior controls are well-placed with a good touch. All this makes it easier and less tiring to drive the car, and even long trips are accomplished in a kind of quiet, easy, and smooth serenity.   With an abundance of safety features to keep you and your loved ones safe from harm, you'll be ecstatic you found this Honda before someone else did! Traction control, side-impact door beams, and an army of airbags are on your team. By any account, the EX is an outstanding car. It's a great opportunity to own a real class-leading car. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2001, miles: 150801, transmission: "Automatic", color: "Satin Silver Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 4999, newused: "Used", vin: "1HGCG22551A031898", stocknumber: "DCSJ228", model: "Accord Cpe", tri