Listing.where(title: "2007 Honda Civic Cpe", description: "Delivering legendary comfort, safety and quality, our Clean Carfax 2007 Honda Civic LX Coupe in Taffeta White sets the bar for its class. It is powered by a 1.8 Liter 4 Cylinder generates 140hp at your command. That power is hustled to the front wheels via a smooth-shifting 5 Speed Automatic transmission to reward you with a stellar 40mpg on the highway as well as responsive handling with steering, suspension and braking working together seamlessly. The classic silhouette of our Front Wheel Drive LX is accented by attractive alloy wheels, same color power mirrors, and door handles.  We're not talking about just a great economy car, it's an outstanding product by almost any measure! Inside, it is packed with amenities including air-conditioning, full power accessories, keyless entry, cruise control and a CD/MP3 player with an auxiliary input jack. Soft cloth seating and front bucket seats add to the comfort of the LX trim.  A Top Safety Pick with ABS, front and rear anti-roll bars, and plenty of air bags offer added piece of mind. Our Civic LX delivers superior reliability combined with a better ride than you might expect from a compact. Dare to compare! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2007, miles: 59742, transmission: "Automatic", color: "Taffeta White", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7999, newused: "Used", vin: "2HGFG12667H585333", stocknumber: "DCSJ218", model: "Civic Cpe", trim: "LX", enginedescription: "1.8L 4 Cylinders", interiorcolor: "Ivory", options: "12V Auxiliary Pwr Outlet,Air Conditioning W/Air Filtration 