Listing.where(title: "2000 Jeep Grand Cherokee", description: "Our 2000 Clean Carfax, Jeep Grand Cherokee Laredo comes to you with a 4.0 liter V6 producing 195-horsepower and comes with a smooth shifting automatic transmission. Without a doubt, this Jeep will get you though whatever you tackle.  Your Laredo will seat five and gives you a myriad of comfort and safety features! Take a look at our pictures, this Laredo has been well cared for and is waiting for you!  So through thick and thin, this Jeep Laredo will get there looking good and arriving in style! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2000, miles: 159557, transmission: "Automatic", color: "Pewter", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 5888, newused: "Used", vin: "1J4G248S8YC391151", stocknumber: "JCSJ207", model: "Grand Cherokee", trim: "Laredo", enginedescription: "4L 6 Cylinders", interiorcolor: "Gray", options: "60/40 Split Folding Rear Seat,Air Conditioning : A/C,Audio : Am/Fm Stereo,Audio : Cassette,Cargo Area Tie Down Loops,Convenience : Luggage Rack,Convenience : Power Outlet,Convenience : Variable Speed Intermittent Wipers,Driver & Front Passenger Next Generation Airbags,Front/Rear Outboard Height-Adjustable Shoulder Belts,Pwr Windows W/Driver 1-Touch Feature,Safety Features : Child Safety Locks,Sentry Key Theft Deterrent System,Steering : Power Steering,Window : Privacy Glass", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: nil, make: "Jeep", approved: true, expiration_date: "2218-01-03 01:44:43", external_url: true, external_image: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176087/20180205181605788_1cdb0079f8764300862b12784d29719f.jpg", ext