Listing.where(title: "2006 Kia Sorento", description: "Our 2006 Sorento LX shown in Ice Blue comes with all the comforts your life demands! With a 3.5 Liter V6 engine that kicks out 192hp, this good-looking family hauler with rear wheel drive is ready to get up and go!  Inside, you'll find spacious seating for everyone and plenty of extra space for cargo! This Sorento will serve you well when hauling home a load of groceries or even supplies for your current home improvement project! Take a look at our pictures! This Sorento LX has been very well cared for....and has a sunroof, leather upholstery, heated front seats and beautiful woodgrain cabin accents!   Our Sorento LX is ready to meet your needs and exceed your expectations! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2006, miles: 150064, transmission: "Manual", color: "Ice Blue", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 6499, newused: "Used", vin: "KNDJD733365637483", stocknumber: "DAVQ238", model: "Sorento", trim: "LX", enginedescription: "3.5L 6 Cylinders", interiorcolor: "Gray", options: "Dvd Player,(4) 12-Volt Pwr Outlets-Inc: Front, 2Nd Row, Cargo Area,(4) Floor-Mounted Cargo Hooks,Air Conditioning : A/C,Audio : Cd Player,Convenience : Cargo Shade,Convenience : Power Outlet,Convenience : Variable Speed Intermittent Wipers,Locks : Power Door Locks,Pwr Windows-Inc: One-Touch Express-Down Driver Window,Seats : Bucket Seats,Seats : Pass-Through Rear Seat,Seats : Rear Bench Seat,Window : Power Windows,Window : Privacy Glass,Window : Rear Defrost", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterio