Listing.where(title: "2004 Nissan Xterra", description: "Our fabulous Clean Carfax 2004 Nissan Xterra XE in Avalanche is geared towards everyone shown. Powered by a 3.3 Liter V6 that delivers 180hp while tethered to a durable Automatic transmission. This Rear Wheel Drive offers near 21mpg, and you will love the rear privacy glass, trailer hitch receiver, running boards, and roof rack!   The interior of this Xterra XE has room for all of your friends and many features that you will love such as air conditioning, comfy cloth seating, power accessories, and more. You will also enjoy the AM/FM/CD audio system for your musical entertainment! Check out the pictures of this great SUV, and you will see that it is perfect for you.   Safety features are not forgotten and include LATCH, child safety locks, airbags, and more! There is nothing else quite like our Xterra XE. It's in its' element when used as a truck or a dirt-road prowler. It can handle wet or dirty cargo and clean up like a champ. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2004, miles: 157567, transmission: "Automatic", color: "Avalanche", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 5895, newused: "Used", vin: "5N1ED28T34C635511", stocknumber: "DAVQ168", model: "Xterra", trim: "XE", enginedescription: "3.3L 6 Cylinders", interiorcolor: "Charcoal", options: "50/50 Split-Fold Rear Seat W/Removable Cushions,Air Conditioning : A/C,Audio : Cd Player,Convenience : Luggage Rack,Convenience : Power Outlet,Driver Side Manual Height Adjuster & Lumbar Support,Front Bucket Seats,Rear Window Defroster,Roof Headliner Net,Seats : Bucket Seats,Seats : Rear Benc